import React from "react";

class RapCard extends React.Component {
  state = {
    clicked: false
  };
  render() {
    console.log(this.props);
    return (
      <div>
        <h2>{this.props.rapper.name}</h2>
        <img alt="" src={this.props.rapper.sadImage} />
        <button>Flip Pic</button>
      </div>
    );
  }
}

export default RapCard;
